				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->Raju kontserttuur Ruja muusika ja muusikutega<br /> 16.-27. juuli ja 21. august 2014. <br />&Uuml;ks raju kontsertuur Eesti vaba&otilde;hulavadel - &quot;Eile n&auml;gin ma Eestimaad&quot;. Taaskohtumine Ruja muusika ja muusikutega. Kogu kontsertkava on RUJA muusikast ja ettekandele tuleb nii &uuml;ldrahvalikult tuntuks saanud ajatud hitte kui kihistust muusikap&auml;randist, millest laiem avalikkus seni midagi ei tea ja mida b&auml;nd omal ajal harva esitas tehniliste v&otilde;imaluste nappuse t&otilde;ttu. B&auml;nd veetis 2 p&auml;eva helisalvestusstuudios ja lindistas 2 olulist lugu, Rein Rannapi - &quot;Eile n&auml;gin ma Eestimaad&quot; ja &quot;Parandamatu&quot;, samuti kestis n&auml;dalane proovisessioon Jaanus N&otilde;gisto kodustuudios.<span style="font-size: 12pt; font-family: 'Calibri','sans-serif'"><br /> <br /> </span><!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-"/>    <m:smallFrac m:val="off"/>    <m:dispDef/>    <m:lMargin m:v