				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>Kord tabasid Uku Suviste ja Kristjan Kasearu end m&otilde;ttelt, et pole kunagi koos laval laulnud. Mehed m&otilde;tlesid ja vaagisid - kellele, miks ja mismoodi? K&auml;es! - V&otilde;iks teha emadele ilusa kingituse, laulaks k&otilde;ige ilusamaid laule ja k&otilde;ige paremini! Ometi j&auml;i tunne, et midagi oleks nagu puudu - natuke oleks nagu veel vaja, no umbes pool meest oleks nagu puudu. Nii said Kristjan ja Uku endale uue toreda lavapatneri 12 aastase Jaagup Tuisu. N&otilde;nda s&uuml;ndiski kontserdile pealkiri &quot;2 1/2 meest&quot;.<br /><!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->9. mai Vanemuise kontserdimaja<br />10. mai Paide kultuurikeskus<br />11. mai Estonia kontserdisaal<br />12. mai P&auml;rnu kontserdimaja</p>  <!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <w:DoNotOptimizeForBrowser/>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-"/>    <m:smallFrac m:val="off"/>    <m:dispDef/>    <m:lMa