			<h1 id="news_article_1135_header" class="news_header"><a href="https://www.piletimaailm.com/performances/46104-lindpriid-vabad-mehed-vabal-maal">Lindpriid-Vabad mehed vabal maal</a></h1>

			<div id="news_article_1135_image" class="news_imageleft">
				<a id="news_article_1135_image_link" href="https://www.piletimaailm.com/performances/46104-lindpriid-vabad-mehed-vabal-maal">
