			<div id="news_article_1135_content" class="news_content">
				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->Indrek Kalda, Toomas Lunge, Jaan S&ouml;&ouml;t on mehed, kes &uuml;hise m&uuml;tsi all moodustavad kollektiivi &quot;Lindpriid&quot;. Ansambel alustas tegevust 1996. aastal. Algusaastatel esitasid nad peamiselt II maailmas&otilde;ja aegseid laule, hiljem on lisandunud repertuaari ka salongi- ja kohvikumuusika. Tihtipeale on esitatavatel paladel &quot;oma lugu&quot;, mida jutustatakse nende juurde. Alati polegi k&uuml;simus kindlas laulus, vaid selles loos, mis lauluga kaasas k&auml;ib. Lisaks eelpool mainitud muusikale v&otilde;ib kuulda Lindpriide esituses veel ka laule filmidest &quot;Inimesed s&otilde;durisinelis&quot;, &quot;Seitseteist kevadist hetke&quot;, &quot;Cherbourg`i vihmavarjud&quot;.<br /> N 3. juuli - Tallinn, Linnateatri lavaauk, kell 21<br /> E 4. august - P&auml;rnu, Ammende Villa aed, kell 19<br /> <span style="font-size: 12pt; font-family: 'Calibri','sans-serif'"><br /> </span><!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-