			<h1 id="news_article_1133_header" class="news_header"><a href="https://www.piletimaailm.com/performances/46094-nele-liis-vaiksoo-lauri-liiv">Nele-Liis Vaiksoo & Lauri Liiv</a></h1>

			<div id="news_article_1133_image" class="news_imageleft">
				<a id="news_article_1133_image_link" href="https://www.piletimaailm.com/performances/46094-nele-liis-vaiksoo-lauri-liiv">
					<img src="https://www.piletimaailm.com/pictures/109795/show" alt=""/>
				</a>
