			<div id="news_article_1133_content" class="news_content">
				&quot;V&auml;ike suvemuusikal&quot; seob kokku nii eesti kui maailma filmi- ja  teatrimuusika paremiku. Laval astuvad &uuml;les n&auml;itlevate lauljatena tuntud  Nele-Liis Vaiksoo ja Lauri Liiv. Klaveri taga v&otilde;tab koha sisse eesti  filmi- ja teatrimuusika grand old man Olav Ehala. Suviselt sundimatus ja  salongililkus atmosf&auml;&auml;ris tulevad ettekandele armastatud soolod ja  duetid nagu n&auml;iteks. &quot;M&otilde;tisklus&quot;, &quot;Siis kui maailm magab veel&quot;,  &quot;Kuuj&otilde;gi&quot;, &quot;The Prayer&quot;, &quot;Tuulevaiksel &ouml;&ouml;l&quot; &quot;Laul p&otilde;hjamaast&quot;, &quot;Kabaree&quot;  jpt. Kuna maestro Ehala on &uuml;ks esinejatest, siis v&otilde;ivad kuulajad  kindlad olla, et kontsertilt ei puudu valik ka tema lugude paremikust.  &quot;V&auml;ike suvemuusikal&quot; on unusatmatu &otilde;htu surematute meloodiate saatel.<br />

			</div>
