				<p>&Uuml;ks, kaks, kolm, neli, m&ouml;&ouml;dus j&auml;llegi &uuml;ks p&auml;ev<br />Mis saab olla veel kaunim, kui &uuml;ks meelierutav suve&otilde;htu, koos teatri, laulu ja hea tujuga.<br />Tule teatraalselt elegantsele kontserdile, kus astuvad &uuml;les humoorika kavaga laulvad n&auml;itlejad: Andres Dvinjaninov, Hannes Kaljuj&auml;rv, Indrek Kalda, Toomas Lunge ja J&uuml;ri Lumiste ehk Kaunimate Aastate Vennaskond. <br /><!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->E 14. juuli - Saue, Vanam&otilde;isa Vaba&otilde;hukeskus<br /> T 15. juuli - Vihula m&otilde;isa aed<br /> K 16. juuli - P&auml;rnu, Ammende Villa aed<br /> N 17. juuli - Tallinn, Linnateatri lavaauk</p>

