			<div id="news_article_1130_content" class="news_content">
				Soojad s&uuml;dasuvised kontserdid<br />Maarja-Liis Ilus<br />Peeter Rebane - kitarr<br />Marek Talts - kitarr<br /><br />Maarja-Liis Ilus juba lapsena vallutas oma lauludega eestlaste s&uuml;damed. Sel suvel saame kuulata-vaadata tema kaunist etteastet juulikuus, kus ta esitab oma tuntumaid laule.

