			<h1 id="news_article_1129_header" class="news_header"><a href="https://www.piletimaailm.com/performances/46016-marko-matvere-ooper-kvartett">Marko Matvere & Ooper Kvartett</a></h1>

			<div id="news_article_1129_image" class="news_imageleft">
				<a id="news_article_1129_image_link" href="https://www.piletimaailm.com/performances/46016-marko-matvere-ooper-kvartett">
					<img src="https://www.piletimaailm.com/pictures/109720/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1129_content" class="news_content">
				<p>Romansid ja mustlasmuusika<br />Mustlasvanker<br />Augusti&otilde;htud koos Marko Matvere ja mustlasmuusikaga, kuhu mahuvad ka jutud ja meenutused. Kontsertkavas &bdquo;Mustlasvanker&ldquo; on laule operettidest, vene romansse, rahvalikke lugusid, Balkanimaade muusikat ning maailmakuulsa mustlasp&auml;ritolu kitarrivirtuoosi Django Reinhardti loomingut.<br />N&auml;itleja Marko Matvere on mustlastemaatikast huvitunud juba viimased paark&uuml;mmend aastat ning seet&otilde;ttu tal on, mida pajatada.<br />Laulud j&otilde;uavad publikuni eesti, vene, inglise ja serbo-horvaadi keeles. </p>

			</div>
