				<p>P&auml;rast seda kui v&auml;ike sportlennuk rammib rikka suurt&ouml;&ouml;sturi majja  ja kaks pardal viibivat pilooti on sunnitud sekkuma majaelanike  eraellu, paljastub &uuml;he pealtn&auml;ha k&otilde;rge moraaliga perekonna t&otilde;eline  n&auml;gu. Miks on noortega nii, et &uuml;ks taevast alla sadanud  armuseiklus v&otilde;ib iga kell &uuml;les kaaluda perekonna k&otilde;rge moraali ja  vanemate aastatepikkuse s&uuml;vakasvatuse??!<br /><strong>M&auml;ngivad</strong>: Roman Baskin, &Uuml;llar Saarem&auml;e, Martin Veinmann, Alo K&otilde;rve, Riho K&uuml;tsar, Epp Eesp&auml;ev, Elina P&auml;hklim&auml;gi, Maria Peterson, Margus Grozn&otilde;i/Andres Raag</p>

