				Suvel meie seast lahkunud rahva poolt armastatud Silvi Vraidi m&auml;lestuseks toimub 30.04 Tallinna Kaarli kirikus kontsert. Kaks p&auml;eva varem oleks Silvi saanud 63-aastaseks. Kontserdil k&otilde;lavad Silvi lauldud lood nii individuaalsest- kui ka FIX-i varasalvest. &quot;Nagu merelaine&quot;, Valguses ja varjus&quot;, &quot;Vana pildiraam&quot; ja &quot;Magus valu&quot; on vaid m&otilde;ned n&auml;ited Silvi pikast ja uhkest repertuaarist. Lisaks FIX-i raskekahurv&auml;ele astuvad kontserdile &uuml;les teiste seas Silver Vrait, Kaire Vilgats, Novella Hanson, Maria Listra, Jaan Elgula ja Raivo Tafenau jt.

