				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>Nukitsamees 50 aastat hiljem, Urmas Vadi tragikom&ouml;&ouml;dia t&auml;iskasvanutele.<br />On m&ouml;&ouml;dunud aastak&uuml;mneid ilma, et me neist midagi kuulnud oleksime. Aga n&uuml;&uuml;d on nad tagasi, on olnud tegelikult kogu aeg. Ja me saame vastuse k&uuml;simusele, kuidas nad elavad. Mis on saanud Nukist? Mis on saanud Itist, Kustist? Kuidas ja kus elavad vanamoor, M&otilde;hk ja T&ouml;lpa? Kuidas on nad suutnud kohaneda t&auml;nap&auml;eva Eestis?&nbsp;  </p><p>M&auml;ngivad: Ago Anderson (Endla), Merle Palmiste (Eesti Draamateater), Raivo E. Tamm, Indrek Taalmaa (Endla), Peeter Volkonski jt.<br />Aprilli l&otilde;puni SOODUSHINNAD!</p>

