				<!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-"/>    <m:smallFrac m:val="off"/>    <m:dispDef/>    <m:lMargin m:val="0"/>    <m:rMargin m:val="0"/>    <m:defJc m:val="centerGroup"/>    <m:wrapIndent m:val="1440"/>    <m:intLim m:val="subSup"/>    <m:naryLim m:val="undOvr"/>   </m:mathPr></w:WordDocument> </xml><![endif]-->  <p>V&otilde;ib juhtuda, et selle lavastuse sisu ja teemad salastatakse 30 aastaks. Uus Vaikiv Ajastu. Lugu r&auml;&auml;gib EW-aegsest tagatoast. Kuidas 1924 loodi koorekihi klubi Centum. Aia tn 12. Seal tehti poliitikat, aeti &auml;ri, peeti balle, v&otilde;eti vastu Euroopa diplomaate ja kuninglikke p&auml;id, spioneeriti. Pidu kestis 1940. aastani. Me n&auml;eme, kuidas P&auml;ts oli osav m&auml;ngur poliitikamaastikul. Kuidas Laidoner suutis oma v&otilde;lgadega endale kaela t&otilde;mmata poliitilise krahhi. Kuidas punased manipulaatorid eesotsas Reiga olid Eestis alati v&otilde;imu juures. Kuidas suur&auml;rimees Puhk maksis k&otilde;ik kinni. Kuidas Eenpalu salapolitsei struktuuri tegi. Kuidas v&auml;lisministrid ja diplomaadid Pusta ja Piip P&auml;tsu ajal patarei vanglas olid. Kuidas vabaduss&otilde;jalastest tehti j&otilde;uga fa&scaron;istid ja Sirk oma otsa leidis. Tegelikult teatakse eelmisest Eesti Vabariigist ainult paraadportreesid. Me ei tea, mida tegelikult t&auml;hendas toonane vaikiv ajastu. Aga me teame, kuhu see viis. Tundub, et mustrid on taaskorduvad. V&otilde;imul ei tohi olla liiga kaua. Jahmatavad paralleelid t&auml;nap&auml;evaga.<strong> Lavastaja Hendrik Toompere jr, osades Ivo Uukkivi, Ain Lutsepp, T&otilde;nu Oja, J&uuml;ri Tiidus, Harriet Toompere, Guido Kangur, Indrek Sammul, Uku Uusberg, Roland Laos, Raimo Pass, Marta Laan, Liisa Pulk, Liis Haab, Tiit Sukk, Lauri Kaldoja.  </strong></p>

