		<div id="news_article_1105" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/45490-varjatud-elu-esitlus">
			<h1 id="news_article_1105_header" class="news_header"><a href="https://www.piletimaailm.com/performances/45490-varjatud-elu-esitlus">"Varjatud elu" esitlus. Diana Klas, Peeter Kaljumäe LIVE</a></h1>

			<div id="news_article_1105_image" class="news_imageleft">
				<a id="news_article_1105_image_link" href="https://www.piletimaailm.com/performances/45490-varjatud-elu-esitlus">
					<img src="https://www.piletimaailm.com/pictures/108494/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1105_content" class="news_content">
				<p>Autobiograafia &laquo;Varjatud elu&raquo; esitlus<br />DIANA KLAS (vokaal) ja PEETER KALJUM&Auml;E (klaveril)<br />13.mail kell 19.00<br />Mustpeade Maja Valge saal<br />Ajaloolisel  ja eriilmselisel muusika ning kirjanduse &uuml;htesulamise raamatu esitlusel  esitab klassikalisi Edith Piafi ja Jacques Breli lummavaid shansoone  Diana Klas. Klaveril saadab n&auml;itleja ja muusik Peeter Kaljum&auml;e, kes loeb  prantsuse traditsiooniliste viiside vahele katkendeid emotsionaalsest  ja sensatsioonilisest autobiograafiast &quot;Varjatud elu&quot;, milles endine  &uuml;rituste korraldaja, raskete haigustega v&otilde;itlev Raivo Kaer toob  lugejateni Eesti meelelahutus&auml;ri ja poliitika telgitaguseid, paljastades  halastamatult iseenda elu traagilised tagamaad ning s&uuml;ndmused.<br />PILETIGA TASUTA RAAMAT! Raamat v&auml;ljastatakse kohapeal pileti esitamisel. </p>

			</div>
