		<div id="news_article_1104" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/45456-smilers-vs-fix">
			<h1 id="news_article_1104_header" class="news_header"><a href="https://www.piletimaailm.com/performances/45456-smilers-vs-fix">SMILERS vs FIX "JALGPALL on parem kui ... TSIRKUS"</a></h1>

			<div id="news_article_1104_image" class="news_imageleft">
				<a id="news_article_1104_image_link" href="https://www.piletimaailm.com/performances/45456-smilers-vs-fix">
					<img src="https://www.piletimaailm.com/pictures/108474/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1104_content" class="news_content">
				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->Noorimadki f&auml;nnidest, kes 1960-ndate l&otilde;pus r&otilde;&otilde;mustasid ansambli Fix esimeste hittide &uuml;le, on n&uuml;&uuml;dseks ammu vanavanemateks saanud. Taaskord koguneb Fix suurele lavale, oma klassikalises koosseisus, koos Novella Hansoniga.<br /> Kuulajate r&otilde;&otilde;muks esitavad valiku Fixi laule ka k&uuml;lalissolistid Koit Toome ja Karl-Erik Taukar. <br /> Smilers on ansambel, mis ajab kompromissitult, kuid hittiderohkelt mehise, kuid l&uuml;&uuml;rilise eestikeelse kitarriroki rida. Mullu t&auml;histas see muusikaline meeskond, mille liider on karismaatiline laulja ja kitarrist Hendrik Sal-Saller, 20 tegutsemisaasta m&ouml;&ouml;dumist. <br /> <br /> Ainult 14. augustil on Tartu laululaval f&auml;nnidel ja huvilistel kordumatu v&otilde;imalus kuulda ja n&auml;ha m&otilde;lemat ansamblit &uuml;hel laval. <span style="font-size: 12pt; font-family: 'Calibri','sans-serif'; color: #333333"><br /> </span><!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"