			<div id="news_article_1101_content" class="news_content">
				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>&quot;Totaalselt sinust &uuml;le&rdquo; on briti kaasaegse n&auml;itekirjaniku Mark Ravenhilli s&auml;rtsakas kom&ouml;&ouml;dia staarikultusest ja romantilistest fantaasiatest. &nbsp;Lavastaja Enn Keerd, t&otilde;lkija Triinu Ojalo, kunstnik Evelyn Bernard. M&auml;ngivad Endla&nbsp;Noortestuudio&nbsp;&otilde;pilased Liis K&uuml;nnapas, Laura-Retti Laos, Carolina Tagobert, Nora Vahenurm, Deborah Kuusik, Triin Veli, Oskar Seeman, Mikk P&auml;rg, Mihkel Tomberg, Carl V&auml;lja&auml;&auml;r, Kaspar Kast, Cardo Sommerhage.<a href="http://www.endla.ee/"><br />www.endla.ee</a>  </p>

