		<div id="news_article_1100" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/43377-rosencrantz-ja-guildenstern-on-surnud">
			<h1 id="news_article_1100_header" class="news_header"><a href="https://www.piletimaailm.com/performances/43377-rosencrantz-ja-guildenstern-on-surnud">“Rosencrantz ja Guildenstern on surnud”</a></h1>

			<div id="news_article_1100_image" class="news_imageleft">
				<a id="news_article_1100_image_link" href="https://www.piletimaailm.com/performances/43377-rosencrantz-ja-guildenstern-on-surnud">
					<img src="https://www.piletimaailm.com/pictures/108179/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1100_content" class="news_content">
				<!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-"/>    <m:smallFrac m:val="off"/>    <m:dispDef/>    <m:lMargin m:val="0"/>    <m:rMargin m:val="0"/>    <m:defJc m:val="centerGroup"/>    <m:wrapIndent m:val="1440"/>    <m:intLim m:val="subSup"/>    <m:naryLim m:val="undOvr"/>   </m:mathPr></w:WordDocument> </xml><![endif]-->  <p>Lavastaja &Uuml;llar Saarem&auml;e: &bdquo;Selle n&auml;idendiga on mul olnud veider side juba aastaid. Roman Baskini lavastust &uuml;hekask&uuml;mnendate alguses (Andrus Vaariku ja Guido Kanguriga peaosades) vaatasin mitmeid kordi. Kandsin teksti endaga, oodates aega, millal ise sellega tegelema hakata - kas n&auml;itleja v&otilde;i lavastajana. 2005. aastal lavastas Hendrik Toompere loo minu palvel Rakvere teatri suvelavastuseks. M&auml;ngisin Rosencrantzi. Guildenstern oli Marko Matvere.&nbsp; Arvasin, et n&uuml;&uuml;d on asjaga &uuml;helpool ja see tekst ei kummita mind enam. M&otilde;ni aeg tagasi leidsin aga end taaskord sellele loole m&otilde;tlemast &hellip;&rdquo;<