		<div id="news_article_1099" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/45406-luisa-vark-ja-artjom-savitski-kevad-koputab">
			<h1 id="news_article_1099_header" class="news_header"><a href="https://www.piletimaailm.com/performances/45406-luisa-vark-ja-artjom-savitski-kevad-koputab">Luisa Värk ja Artjom Savitski- Kevad koputab</a></h1>

			<div id="news_article_1099_image" class="news_imageleft">
				<a id="news_article_1099_image_link" href="https://www.piletimaailm.com/performances/45406-luisa-vark-ja-artjom-savitski-kevad-koputab">
					<img src="https://www.piletimaailm.com/pictures/108149/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1099_content" class="news_content">
				<p>Klaveril saadab Hannes Agur Vellend<br />Kontserdil Kevad koputab esitavad artistid enda tuntud laule mitmel h&auml;&auml;lel, sekka armastatud Eesti meloodiaid.<br />Luisa V&auml;rk ja Artjom Savitski on m&otilde;lemad tuule tiibadesse saanud telesaatest Eesti otsib Superstaari, kus m&otilde;lemad j&auml;id teisele auv&auml;&auml;rsele kohale, Luisa 2007 ja Artjom 2011 aastal.<br />Luisa arvates on Artjom hea huumorisoonega ja karismaatiline laulja, kellega koos on tal hea meel lavale astuda.<br />Artjom &uuml;tleb: &quot;Luisa V&auml;rk on heas&uuml;damlik ning sihikindel artist, kellega on v&auml;ga hea ja lihtne koos t&ouml;&ouml;tada. Ta teab, mida ta tahab ja ta ka saavutab selle. Ootan juba p&otilde;nevusega kevadkontserte, et saaksin koos &uuml;he andeka Eesti naislauljaga koos musitseerida.&quot; </p>

			</div>
