		<div id="news_article_1097" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/45179-kvartett">
			<h1 id="news_article_1097_header" class="news_header"><a href="https://www.piletimaailm.com/performances/45179-kvartett">Kvartett</a></h1>

			<div id="news_article_1097_image" class="news_imageleft">
				<a id="news_article_1097_image_link" href="https://www.piletimaailm.com/performances/45179-kvartett">
					<img src="https://www.piletimaailm.com/pictures/107794/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1097_content" class="news_content">
				See on liigutav ja koomiline lugu neljast inglise ooperit&auml;hest, kes  satuvad taas kokku kunstiinimeste vanadekodus. Meenutatakse huvitavaid  seiku s&auml;ravast karj&auml;&auml;rist ja pinnale kerkib ka omavaheline rivaliteet.  Kunagised armumised ja lahkuminekud annavad n&uuml;&uuml;dki veel p&otilde;hjust  &otilde;hkamiseks ja kemplemiseks. Kired l&ouml;&ouml;vad j&auml;lle l&otilde;kkele, nii et h&auml;diste  vanurite l&otilde;putust heietamisest on asi p&auml;ris kaugel. &Uuml;le pika aja  m&auml;ngivad laval koos Estonia suured staarid <strong>Helgi Sallo</strong> ja <strong>Katrin  Karisma</strong>, lisaks neile veel<strong> T&otilde;nu Aav </strong>(Eesti Draamateater) ja Estonia  endine solist <strong>Hans Miilberg</strong>. Kunstnik Riina Vanhanen ja helilooja Jaak  J&uuml;risson. Lavastus on p&uuml;hendatud T&otilde;nu Aava ja lavastaja Ago-Endrik Kerge  75. juubelile.

			</div>
