				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:TargetScreenSize>800x600</o:TargetScreenSize>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>Richard Stilgoe &amp; Andrew Lloyd Webberi libreto p&otilde;hineb Gaston Leroux romaanil &bdquo;&ldquo;Le Fantome de&rsquo;l&rsquo;Op&eacute;ra&ldquo;<br /><strong>Muusika:</strong> Andrew Lloyd Webber <br /><strong>Eestikeelne t&otilde;lge:</strong> Leelo Tungal <br /> <strong>Lavastaja:</strong> Georg Malvius<br /><strong>Muusikaline juht ja dirigent</strong>: Tarmo Leinatamm <br /> <strong>Dekoratsioonid</strong>: Iir Hermeliin<br /><strong>Osades</strong>: Stephen Hansen (Norra), Hanna-Liina V&otilde;sa v&otilde;i Maria Listra, Koit Toome jt<br />Esmakordselt tutvustas maailmale ooperifantoomi&nbsp; prantsuse kirjanik G. Leroux&rsquo; j&auml;rjejutuna v&auml;ljaandes Le Gaulois 1905. aastal. T&auml;naseks on originaalromaani&nbsp; varjutanud paljud j&auml;rgnenud lava- ja filmiversioonid, mille hulgast on tuntumad 1925. aastast p&auml;rinev tummfilmiklassikasse kuuluv teos Lon Chaney&rsquo;lt ja Rupert Julianilt ning loomulikult A. L. Webberi 1986. aastal loodud lummava ja unustamatu k&otilde;laga muusikal.<br />Esietendus Tartus 4. oktoobril Vanemuise teatris ja Tallinnas 30. oktoobril Nokia Kontserdimajas<br />Eesti keeles, ingliskeelsete ja soomekeelsete subtiitritega</p>  <!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    