				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]--><strong>Rain Simmul<br /> Jaan S&ouml;&ouml;t</strong><br /> Raimond Valgre laulud on leidnud koha iga eestlase s&uuml;dames. Kuid mida m&otilde;tles ja tundis sisimas nende laulude looja ise? N&auml;itleja Rain Simmul ja muusik Jaan S&ouml;&ouml;t toovad aprillis vaatajate-kuulajate ette emotsionaalse kontsertetenduse Raimond Valgrest. Lisaks meile k&otilde;igile tuntud lauludele k&otilde;lavad seal ka katkendid Valgre kirjavahetusest, mis lubavad meil heita pilku selle suurmehe m&otilde;tetesse ja tunnetesse.<br /> R 18. aprill - Mooste m&otilde;isa Folgikoda, kell 19<br /> L 19. aprill - Kuressaare Kultuurivara, kell 19<br /> P 20. aprill - Tallinn, Mustpeade Maja, kell 18<br /> L 26. aprill - Vihula m&otilde;is, kell 17<span style="font-size: 12pt; font-family: 'Calibri','sans-serif'"><br /> <br /> </span><!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-"/>    <m:smallFrac m:val="off"/>    <m:dispDef/>    <m:lMargin m:val="0"/>    <m:rMargin m