		<div id="news_article_1079" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/42887-aiamajas">
			<h1 id="news_article_1079_header" class="news_header"><a href="https://www.piletimaailm.com/performances/42887-aiamajas">„Aiamajas“, lugu emadest ja tütardest</a></h1>

			<div id="news_article_1079_image" class="news_imageleft">
				<a id="news_article_1079_image_link" href="https://www.piletimaailm.com/performances/42887-aiamajas">
					<img src="https://www.piletimaailm.com/pictures/106700/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1079_content" class="news_content">
				<!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-"/>    <m:smallFrac m:val="off"/>    <m:dispDef/>    <m:lMargin m:val="0"/>    <m:rMargin m:val="0"/>    <m:defJc m:val="centerGroup"/>    <m:wrapIndent m:val="1440"/>    <m:intLim m:val="subSup"/>    <m:naryLim m:val="undOvr"/>   </m:mathPr></w:WordDocument> </xml><![endif]-->  <p>Kui Ivan Turgenevi kuulsa romaani pealkiri on &bdquo;Isad ja pojad&ldquo;, siis uut lavastust v&otilde;iks lavastaja Priit Pedajase s&otilde;nutsi tutvustada kui &bdquo;Emad ja t&uuml;tred&ldquo;. Ema-t&uuml;tre paare on n&auml;idendis kolm. Keskealised emad p&uuml;&uuml;avad oma elu elada t&uuml;tarde kaudu, teismeea l&otilde;pus t&uuml;tred nii ihaldavad kui ka kardavad vabadust ja iseseisvust. Vastandlikud tunded &ndash; kokkukuuluvuse ja s&otilde;ltumatuse vajadus, armastus ja armukadedus, jumaldamine ja vihkamine, truuduse n&otilde;udmine ja truuduse murdmine &ndash; on nii l&auml;bi p&otilde;imunud, et m&otilde;lemal poolel on raske iseseisev olla. <br /> Autor<strong> Jane Bowles</strong>. Lavastaja <strong>Priit Pedajas</strong>. Kunstnik <strong>Pille J&auml;nes</strong>. Osades <strong>&Uuml;lle Kaljuste, Jaan Rekkor, Maria Klenskaja, Laine M&auml;gi, Taavi Teplenkov, Kersti Heinloo, Hilje Murel, Viire Valdma, Marta Laan, Ester Pajusoo, Mari Lill</strong>.<br /> </p>

