		<div id="news_article_1078" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/43227-uno-bossa-ehk-uno-loobi-seitse-elu">
			<h1 id="news_article_1078_header" class="news_header"><a href="https://www.piletimaailm.com/performances/43227-uno-bossa-ehk-uno-loobi-seitse-elu">Fantastiline Uno Loop</a></h1>

			<div id="news_article_1078_image" class="news_imageleft">
				<a id="news_article_1078_image_link" href="https://www.piletimaailm.com/performances/43227-uno-bossa-ehk-uno-loobi-seitse-elu">
					<img src="https://www.piletimaailm.com/pictures/105860/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1078_content" class="news_content">
				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>Rakvere Teatris esietendus 14. veebruaril muusikaline estraadilavastus &quot;Uno Bossa ehk Uno Loobi seitse elu&quot;, milles r&auml;nnatakse m&ouml;&ouml;da Uno Loobi fantastilisi elus&uuml;ndmusi ja esitatakse hulk tema poolt kuulsaks lauldud laule. &Auml;ratundmisr&otilde;&otilde;mu toovad &bdquo;Mis v&auml;rvi on armastus&ldquo;, &bdquo;Meie Lipsi&ldquo;, &bdquo;Tihemetsa Tiina&ldquo;, &bdquo;Sepa jutustus&ldquo;, L&otilde;ke preerias&ldquo;, &bdquo;Me pole enam v&auml;ikesed&ldquo; ja paljud teised tuntud laulud. Peep Pedmansoni kirjapandud ja Hardi Volmeri lavastatud loos kohtuvad vaatajad lisaks Loobile veel mitmete omaaegsete lavat&auml;htedega nagu Heidy, Heli ja Ivoga, kes n&otilde;ukogude s&uuml;steemi absurdis end estraadilavade ja televisiooni abil eestimaalaste s&uuml;dametesse laulsid. Lavastuse nimitegelast kehastab Margus Grosn&otilde;i ning kaasa teeb ka b&auml;nd. </p>

			</div>
