			<h1 id="news_article_1071_header" class="news_header"><a href="https://www.piletimaailm.com/performances/43226-siseturism-ja-tahelaev">SISETURISM ja TÄHELAEV</a></h1>

			<div id="news_article_1071_image" class="news_imageleft">
				<a id="news_article_1071_image_link" href="https://www.piletimaailm.com/performances/43226-siseturism-ja-tahelaev">
