		<div id="news_article_1055" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/25497-ring">
			<h1 id="news_article_1055_header" class="news_header"><a href="https://www.piletimaailm.com/performances/25497-ring">"RING“ koomiline abieludraama</a></h1>

			<div id="news_article_1055_image" class="news_imageleft">
				<a id="news_article_1055_image_link" href="https://www.piletimaailm.com/performances/25497-ring">
					<img src="https://www.piletimaailm.com/pictures/45267/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1055_content" class="news_content">
				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:TargetScreenSize>800x600</o:TargetScreenSize>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>Autor: W. S. Maugham<br />Lavastaja: Roman Baskin<br />Kunstnik: Ann Lumiste<br />M&auml;ngivad: Kersti Kreismann, Laura Peterson/Karin Rask, Epp Eesp&auml;ev, T&otilde;nu Aav/Volli K&auml;ro, Peeter Jakobi, Andres Raag, Ott Aardam jt.<br />Aastaid on seltskonnas liikunud legend, kuidas &uuml;ks abielunaine j&auml;ttis&nbsp; armuhoos oma abikaasa&nbsp;&nbsp; ja&nbsp; 5-aastase poja ning p&otilde;genes mehe parima s&otilde;braga - j&auml;&auml;davalt. N&uuml;&uuml;d , 30 aastat hiljem, k&uuml;lastab see naine oma kunagist kodukohta ja teeb visiidi&nbsp; oma t&auml;isealisele pojale ja tema v&otilde;luvale kaasale. Juhuslikult on kohal ka poja isa, kunagine h&uuml;ljatu, aga mis veelgi intrigeerivam - kutsutud on ka poja hea s&otilde;ber. &Otilde;hus on elektrit. Kas t&otilde;esti on v&otilde;imalus, et kunagine meeletus kordub?  </p>

			</div>
			<div class="clear"></div>
		</div>

		<div class="clear"></div>
	</div>
