		<div id="news_article_1051" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/41911-marko-matvere-kontserttuur-merelaulud">
			<h1 id="news_article_1051_header" class="news_header"><a href="https://www.piletimaailm.com/performances/41911-marko-matvere-kontserttuur-merelaulud">Marko Matvere - Merelaulud</a></h1>

			<div id="news_article_1051_image" class="news_imageleft">
				<a id="news_article_1051_image_link" href="https://www.piletimaailm.com/performances/41911-marko-matvere-kontserttuur-merelaulud">
					<img src="https://www.piletimaailm.com/pictures/44868/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1051_content" class="news_content">
				Kontserdil k&otilde;lavad vanad merelaulud ja ballaadid koos jutuga   purjelaevanduse kuldajast. Purjelaevanduse hiilgeajaks loetakse 16-20   sajandit. Sel perioodil toimetasid raapurjede all s&otilde;itvad laevad kaupu   ja v&auml;ljar&auml;ndajaid k&otilde;ikidesse maailmajagudesse. Sellest perioodist   p&auml;rineb ka merelaulude traditsioon - shanty, millest omakorda arenes   t&auml;nap&auml;evane, meile nii armas merelaul. Purjelaevade ajastu l&otilde;petas   aurumasina t&auml;iustamine ning l&otilde;pliku hoobi andis sisep&otilde;lemismootori   kasutuselev&otilde;tt. K&otilde;ige ilusamad, romantilisemad ja l&otilde;busamad laulud on   t&auml;nap&auml;eva j&otilde;udnud 19. sajandist. Marko Matvere: &bdquo;K&otilde;ik armastatumad   mereromantikutest laulukirjutajad toetuvad oma loomingus sellele   p&auml;rimusele. Laevad olid siis puust ja mehed rauast.&ldquo;

			</div>
