				<!--[if !mso]> <style> v\:* {behavior:url(#default#VML);} o\:* {behavior:url(#default#VML);} w\:* {behavior:url(#default#VML);} .shape {behavior:url(#default#VML);} </style> <![endif]-->  <p>Muusikal Argentiina presidendi Juan Per&oacute;ni naise Eva Per&oacute;ni tormilisest elu, jutustatuna teise tolleaegse poliitikategelase-popikooni Ch&eacute; Guevara suu l&auml;bi.<br />Helilooja Andrew Lloyd Webber <br />Libretist Tim Rice <br /> Lavastaja Georg Malvius (Rootsi) <br /> Muusikajuht ja dirigent Tarmo Leinatamm <br /> Kunstnik Ellen Cairns (&Scaron;otimaa) <br /> Osades Evelin V&otilde;igemast (Tallinna Linnateater), Kalle Sepp, Vaiko Eplik, Aivar Tommingas, Rasmus Kull, Erkki Rebane, Indrek Ventmann.<br /> Kaasa teevad Vanemuise s&uuml;mfooniaorkester, balletir&uuml;hm, ooperikoor ja live-b&auml;nd. Eesti keeles, ingliskeelsete ja soomekeelsete subtiitritega.<br />Vanemuise teatris alates 31. jaanuarist ja Tallinnas 7.-8. m&auml;rtsil Nokia Kontserdimajas</p>

