		<div id="news_article_1034" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/42277-leke">
			<h1 id="news_article_1034_header" class="news_header"><a href="https://www.piletimaailm.com/performances/42277-leke">Jordi Galceran „Leke“</a></h1>

			<div id="news_article_1034_image" class="news_imageleft">
				<a id="news_article_1034_image_link" href="https://www.piletimaailm.com/performances/42277-leke">
					<img src="https://www.piletimaailm.com/pictures/43503/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1034_content" class="news_content">
				<!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-"/>    <m:smallFrac m:val="off"/>    <m:dispDef/>    <m:lMargin m:val="0"/>    <m:rMargin m:val="0"/>    <m:defJc m:val="centerGroup"/>    <m:wrapIndent m:val="1440"/>    <m:intLim m:val="subSup"/>    <m:naryLim m:val="undOvr"/>   </m:mathPr></w:WordDocument> </xml><![endif]-->  <p>Ministri korruptsiooniskeemid on ajakirjandusse lekkinud. Ja ta on hiljuti naisest lahku l&auml;inud. Enesetapum&otilde;tteid haududes istub mees oma luksusvillas ja ootab oma viimaseks kaaslaseks tellitud eliitprostituudi saabumist (aga ukse taha tuleb hoopis gaasip&otilde;letikaitsete m&uuml;&uuml;ja). Ei-ei, see pole valimisteaegne k&otilde;mu-uudis m&otilde;nest eesti portaalist, vaid n&otilde;nda algab tuntuima katalaani kom&ouml;&ouml;diakirjaniku Jordi Galcerani n&auml;idend &bdquo;Leke&ldquo;. Edasi juhtuvat aga lihtsalt ei saa ega tohi &auml;ra jutustada &ndash; sest publikut ei v&otilde;i ilma j&auml;tta kogu p&otilde;nevuse, ootamatuse ja &auml;ratundmise m&otilde;nust! Pealegi juhtub seal nii peadp&ouml;&ouml;ritavalt palju ja naljakaid asju. Lavastaja <strong>Hendrik Toompere jr</strong>, kunstnik<strong> Riina Degtjarenko</strong>. Osades <strong>Merle Palmiste</strong>, <strong>Marta Laan</strong>, <strong>Jan Uusp&otilde;ld</strong>,<strong> Sulev Teppart</strong>, <strong>Lauri Kaldoja</strong>. </p>

