		<div id="news_article_1018" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/42108-hiired-pooningul">
			<h1 id="news_article_1018_header" class="news_header"><a href="https://www.piletimaailm.com/performances/42108-hiired-pooningul">„Hiired Pööningul“ </a></h1>

			<div id="news_article_1018_image" class="news_imageleft">
				<a id="news_article_1018_image_link" href="https://www.piletimaailm.com/performances/42108-hiired-pooningul">
					<img src="https://www.piletimaailm.com/pictures/42611/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1018_content" class="news_content">
				<p>&bdquo;Hiired P&ouml;&ouml;ningul&ldquo; on lugu kahe hiire, t&otilde;ugu ja nahkhiire elust p&ouml;&ouml;ningul. Hallhiir, t&otilde;uk ja nahkhiir elavad p&ouml;&ouml;ningul oma harjumusp&auml;rast rahulikku elu, kui &auml;kki saabub nende juurde elama valge toahiir Nunnu, kes n&auml;eb maailma hoopis teistes v&auml;rvides, keeldub reaalsusega leppimast ning p&ouml;&ouml;rab nii m&otilde;nedki endiste elanike vaated pea peale. Lavastus r&auml;&auml;gib s&otilde;prusest, kadedusest, unistamisest, hirmudest ja andestamisest. Autor Andrus Kivir&auml;hk, lavastaja Priit Loog, kunstnik Kaili Viidas.<br />Osades Ireen Kennik, Triin Lepik, Sten Karpov ning Lauri Kink</p>

			</div>
