		<div id="news_article_1014" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/39107-totu-kuul">
			<h1 id="news_article_1014_header" class="news_header"><a href="https://www.piletimaailm.com/performances/39107-totu-kuul">Totu kuul</a></h1>

			<div id="news_article_1014_image" class="news_imageleft">
				<a id="news_article_1014_image_link" href="https://www.piletimaailm.com/performances/39107-totu-kuul">
					<img src="https://www.piletimaailm.com/pictures/42315/show" alt=""/>
				</a>
			</div>

