				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:TargetScreenSize>800x600</o:TargetScreenSize>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>Fantastiline ulmemuinasjutt<br />Autor Nikolai Nossov <br />Lavastaja Kaili Viidas (Endla teater) <br /> Osades: Priit Strandberg, Rein Pakk, Ragne Pekarev, Ott Sepp, jt<br />Kaasahaarav ja seikluslik ulmemuinasjutt, mis kirjutatud juba pool sajandit tagasi. Marakann Totu ja tema kentsakate s&otilde;prade humoorikad seiklused Kuul pakuvad nalja ja &auml;ratundmisr&otilde;&otilde;mu nii suurematele kui v&auml;iksematele vaatajatele. <br />Soovitatav alates koolieast.</p>  <!--[if gte mso 9]><xml>  <w:WordDocument>   <w:View>Normal</w:View>   <w:Zoom>0</w:Zoom>   <w:TrackMoves/>   <w:TrackFormatting/>   <w:HyphenationZone>21</w:HyphenationZone>   <w:PunctuationKerning/>   <w:ValidateAgainstSchemas/>   <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>   <w:IgnoreMixedContent>false</w:IgnoreMixedContent>   <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>   <w:DoNotPromoteQF/>   <w:LidThemeOther>ET</w:LidThemeOther>   <w:LidThemeAsian>X-NONE</w:LidThemeAsian>   <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>   <w:Compatibility>    <w:BreakWrappedTables/>    <w:SnapToGridInCell/>    <w:WrapTextWithPunct/>    <w:UseAsianBreakRules/>    <w:DontGrowAutofit/>    <w:SplitPgBreakAndParaMark/>    <w:EnableOpenTypeKerning/>    <w:DontFlipMirrorIndents/>    <w:OverrideTableStyleHps/>   </w:Compatibility>   <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>   <m:mathPr>    <m:mathFont m:val="Cambria Math"/>    <m:brkBin m:val="before"/>    <m:brkBinSub m:val="&#45;-"/>    <m:smallFrac m:val="off"/>    <m:dispDef/>    <m:lMargin m:val="0"/>    <m:rMargin m:val="0"/>    <m:defJc m:val="centerGroup"/>    <m:wrapIndent m:val="1440"/>    <m:intLim m:val="subSup"/>    <m:naryLim m:val="undOvr"/>   </m:mathPr></w:WordDocument> </xml><![endif]--><!--[if gte mso 9]><xml>  <w:LatentStyles DefLockedState