		<div id="news_article_1006" class="news_article1 news_article" data-url="https://www.piletimaailm.com/performances/42600-hostell">
			<h1 id="news_article_1006_header" class="news_header"><a href="https://www.piletimaailm.com/performances/42600-hostell">Hostell</a></h1>

			<div id="news_article_1006_image" class="news_imageleft">
				<a id="news_article_1006_image_link" href="https://www.piletimaailm.com/performances/42600-hostell">
					<img src="https://www.piletimaailm.com/pictures/41706/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1006_content" class="news_content">
				Selle kom&ouml;&ouml;dia&nbsp;lavastajaks on &uuml;ks tuntumaid tegijaid meie huumorialal  <strong>Anne Paluver</strong>, m&auml;ngivad <strong>Henrik Normann</strong>, <strong>Eva P&uuml;ssa</strong>, <strong>V&auml;ino Laes</strong>, <strong>Terje  Pennie</strong> ja <strong>Tarvo Krall</strong>. &bdquo;Ho(s)tell&ldquo; on naljakas lugu sellest, kuidas  kaks&nbsp;meest &uuml;le aisa l&ouml;&ouml;vad &ndash; ise teadmata, et nende abikaasad on samas  majas oma armukesega, lihtsalt paarid on sassi l&auml;inud. Ja kohalik  administraator poeb nahast v&auml;lja, et valed inimesed valel ajal kokku ei  satuks ning tiivaripsutamine avalikuks ei saaks. P&ouml;&ouml;rased situatsioonid  annavad vaevalt mahti toibumiseks, kuni saabub ootamatu l&otilde;pplahendus.  Pealkirja omap&auml;rane kirjapilt viitab aga sellele, et nurgatagune  provintsihotell on nii interj&ouml;&ouml;ri kui teeninduse poolest pigem nagu  hostel...

			</div>
