			<h1 id="news_article_1005_header" class="news_header"><a href="https://www.piletimaailm.com/performances/41957-hobune-kes-kaotas-prillid-ara">HOBUNE, KES KAOTAS PRILLID ÄRA</a></h1>

			<div id="news_article_1005_image" class="news_imageleft">
				<a id="news_article_1005_image_link" href="https://www.piletimaailm.com/performances/41957-hobune-kes-kaotas-prillid-ara">
					<img src="https://www.piletimaailm.com/pictures/41658/show" alt=""/>
				</a>
			</div>

			<div id="news_article_1005_content" class="news_content">
				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>Detsembris j&otilde;uab Rakvere Teatri lavale seikluslik koguperelavastus &bdquo;Hobune, kes kaotas prillid &auml;ra&ldquo;. Selle peategelaseks on &uuml;ks ja ainus, naeratav ja s&uuml;damlik Hobune, kelle rinnus tuksub kartmatu hobuses&uuml;da, kes t&otilde;mbab p&auml;he tutim&uuml;tsi, kaela salli ning asub teele... Etendused toimuvad koos j&otilde;ulumaaga ning piletihinnas on kingitus.<br />Autor Hannu M&auml;kela, lavastaja Elina P&auml;hklim&auml;gi, kunstnik Nele Soov&auml;li, muusikaline kujundaja Marten Kuningas, m&auml;ngivad Tarvo S&otilde;mer, &Uuml;lle Lichtfeldt, Eduard Salmistu, Maarika Mesipuu, Liisa Aibel, Helgi Annast, Indrek Apinis, Peeter R&auml;stas.  </p>

			</div>
