			<h1 id="news_article_1004_header" class="news_header"><a href="https://www.piletimaailm.com/performances/41300-topeltelu">Ray Cooney tempokas komöödia „Topeltelu“.</a></h1>

			<div id="news_article_1004_image" class="news_imageleft">
				<a id="news_article_1004_image_link" href="https://www.piletimaailm.com/performances/41300-topeltelu">
					<img src="https://www.piletimaailm.com/pictures/41486/show" alt=""/>
				</a>
