				<!--[if gte mso 9]><xml>  <o:OfficeDocumentSettings>   <o:AllowPNG/>  </o:OfficeDocumentSettings> </xml><![endif]-->  <p>Haldjas Berylune annab &otilde;ele Mytylile ja vennale Tyltylile &uuml;lesande otsida &uuml;les salap&auml;rane Sinilind, kelle omamine raviks terveks haldja haige t&uuml;tre. Lapsed koos omap&auml;rase reisiseltskonnaga &ndash; Kassi, Koera, Suhkru ja Leivaga otsivad Sinilindu M&auml;lestustemaalt, &Ouml;&ouml; paleest, Tuleviku kuningriigist, Valguse templist ja metsast.&nbsp; <br />M. Maeterlincki aegumatu loo lavastas Ingo Normet, kunstnik Liina Unt, m&auml;ngivad Karin Tammaru, Carmen Mikiver, Helle Kuningas, Triin Lepik, Kaili Viidas, Ireen Kennik, Bert Raudsep, Ago Anderson, J&uuml;ri Vlassov, Sten Karpov, Priit Loog, Jaanus Mehikas,&nbsp; Ahti Puudersell.<br />Etendused Endla Teatri Suures saalis. </p>

